		la t0, SHOOT
		lb t1, 0(t0)
		li t2, 1
		beq t1, t2, FIM_ATIRAR
		li t1, 1
		sb t1, 0(t0)
		la t0, PEQUENO_GRANDE
		lb t0, 0(t0)
		beq t0, zero, FIM_ATIRAR
		la t0, ESQUERDA_DIREITA
		lb t0, 0(t0)
		beq t0, zero, ATIRAR_ESQUERDA
