		mv t0, t2
		addi t0, t0, 4
		lb t0, 0(t0)
		beq t0, zero, INIMIGO_UP
		j INIMIGO_DOWN
		
INIMIGO_UP:
		la t0, mapa_teste_153		#endereco do mini_background
		addi t0, t0, 8			#pula a largura e a altura
		li t3, 153			#carrega 8 em t3
		lh t4, 0(t2)			#carrega o y em t4
		mul t4, t4, t3			#em qual linha o CHAR est 
		lh t3, 2(t2)			#carrega o x em t3
		add t4, t4, t3			#em qual coluna o CHAR esta
		add t0, t0, t4			#endereco do CHAR_POS na matriz
		#procedimento que averigua colisao
		addi t0, t0, -153		#novo endereco do CHAR_POS na matriz
		lb t3, 0(t0)			#carrega o valor de CHAR_POS da matriz
		addi t0, t0, 153
		li t5, 5
		beq t3, t5, MORTE
		li t5, 6
		beq t3, t5, MORTE
		li t5, 7
		beq t3, t5, MORTE
		li t5, 1
		beq t3, t5, MUDA		#v  para GAME_LOOP
		li t3, 0			#carrega 0 em t3
		sb t3, 0(t0)			#colocando 0 no endereco
		li t3, 8			#carrega 2 em t3
		addi t0, t0, -153		#novo endereco do CHAR_POS na matriz
		sb t3, 0(t0)			#colocando 2 no endereco
		lh t3, 0(t2)			#carrega o y em t3
		addi t3, t3, -1			#decrementa um em t3
		sh t3, 0(t2)			#novo CHAR_POS
		csrr t0, time
		sw t0, 0(t6)
		ret
INIMIGO_DOWN:
		la t0, mapa_teste_153		#endereco do mini_background
		addi t0, t0, 8			#pula a largura e a altura
		li t3, 153			#carrega 8 em t3
		lh t4, 0(t2)			#carrega o y em t4
		mul t4, t4, t3			#em qual linha o CHAR est 
		lh t3, 2(t2)			#carrega o x em t3
		add t4, t4, t3			#em qual coluna o CHAR esta
		add t0, t0, t4			#endereco do CHAR_POS na matriz
		#procedimento que averigua colisao
		addi t0, t0, 153		#novo endereco do CHAR_POS na matriz
		lb t3, 0(t0)			#carrega o valor de CHAR_POS da matriz
		addi t0, t0, -153
		li t5, 5
		beq t3, t5, MORTE
		li t5, 6
		beq t3, t5, MORTE
		li t5, 7
		beq t3, t5, MORTE
		li t5, 1
		beq t3, t5, MUDA_1		#v  para GAME_LOOP
		li t3, 0			#carrega 0 em t3
		sb t3, 0(t0)			#colocando 0 no endereco
		li t3, 8			#carrega 2 em t3
		addi t0, t0, 153		#novo endereco do CHAR_POS na matriz
		sb t3, 0(t0)			#colocando 2 no endereco
		lh t3, 0(t2)			#carrega o y em t3
		addi t3, t3, 1			#decrementa um em t3
		sh t3, 0(t2)			#novo CHAR_POS
		csrr t0, time
		sw t0, 0(t6)
		ret

MORTE:
		#parte superior
		la t0, mapa_teste_153	#endereco do mini_background
		addi t0, t0, 8		#pula a largura e a altura
		la t2, CHAR_POS_UP	#endereco de CHAR_POS_UP
		li t3, 153		#carrega 8 em t3
		lh t4, 0(t2)		#carrega o y em t4
		mul t4, t4, t3		#em qual linha o CHAR est 
		lh t3, 2(t2)		#carrega o x em t3
		add t4, t4, t3		#em qual coluna o CHAR est 
		add t0, t0, t4		#endereco do CHAR_POS na matriz
		li t1, 0
		sb t1, 0(t0)
		#BAIXO
		la t0, mapa_teste_153	#endereco do mini_background
		addi t0, t0, 8		#pula a largura e a altura
		la t2, CHAR_POS_DOWN	#endereco de CHAR_POS
		li t3, 153		#carrega 8 em t3
		lh t4, 0(t2)		#carrega o y em t4
		mul t4, t4, t3		#em qual linha o CHAR est 
		lh t3, 2(t2)		#carrega o x em t3
		add t4, t4, t3		#em qual coluna o CHAR est 
		add t0, t0, t4		#endereco do CHAR_POS na matriz
		li t1, 0
		sb t1, 0(t0)
		
		la t0, mapa_teste_153
		addi t0, t0, 8
		la t2, CHECKPOINT	#endereco de CHAR_POS
		li t3, 153		#carrega 4 em t3
		lh t4, 0(t2)		#carrega o y em t4
		mul t4, t4, t3		#em qual linha o CHAR est 
		lh t3, 2(t2)		#carrega o x em t3
		add t4, t4, t3		#em qual coluna o CHAR est
		add t0, t0, t4
		li t1, 5
		sb t1, 0(t0)
		la t0, CHAR_POS_UP
		lh t4, 0(t2)
		sh t4, 0(t0)
		lh t4, 2(t2)
		sh t4, 2(t0) 
		
		la t0, mapa_teste_153
		addi t0, t0, 8
		la t2, CHECKPOINT	#endereco de CHAR_POS
		li t3, 153		#carrega 4 em t3
		lh t4, 4(t2)		#carrega o y em t4
		mul t4, t4, t3		#em qual linha o CHAR est 
		lh t3, 6(t2)		#carrega o x em t3
		add t4, t4, t3		#em qual coluna o CHAR est
		add t0, t0, t4
		li t1, 6
		sb t1, 0(t0) 
		la t0, CHAR_POS_DOWN
		lh t4, 4(t2)
		sh t4, 0(t0)
		lh t4, 6(t2)
		sh t4, 2(t0) 
		
		la t0, POS_MAPA
		la t1, CHECKPOINT
		lh t1, 2(t1)
		addi t1, t1, -2
		sh t1, 0(t0)
		
		la t0, PEQUENO_GRANDE
		li t1, 1
		sb t1, 0(t0)
		
		la t0, VIDA
		lb t1, 0(t0)
		addi t1, t1, -20
		sb t1, 0(t0)
		
		beq t1, zero, MORTE_FINAL
		j FIM


MUDA:
		li t1, 1
		mv t0, t2
		addi t0, t0, 4
		sb t1, 0(t0)
		ret

MUDA_1:
		mv t0, t2
		addi t0, t0, 4
		sb zero, 0(t0)
		ret
		
INIMIGOS_MAPA_2:
		addi sp, sp, -4
		sw ra, 0(sp)
		addi sp, sp, 4
		la a0, LASER_1
		la a1, LASER_1_COOLDOWN
		jal LASER_INIMIGO
		la a0, LASER_2
		la a1, LASER_2_COOLDOWN
		jal LASER_INIMIGO
		la a0, LASER_3
		la a1, LASER_3_COOLDOWN
		jal LASER_INIMIGO
		la a0, LASER_4
		la a1, LASER_4_COOLDOWN
		jal LASER_INIMIGO
		addi sp, sp, -4
		lw ra, 0(sp)
		addi sp, sp, 4
		ret
		
LASER_INIMIGO:
		lb t0, 3(a0)
		bne t0, zero, DESLIGA
		la t0, TEMPO_ATUAL		#carrega o endereco do TEMPO_ATUAL
		lw t0, 0(t0)			#carrega o TEMPO_ATUAL
		lw t1, 0(a1)			#carrega o TEMPO_PARA_COMECAR_A_CAIR
		sub t0, t0, t1			#t0 = t0 - t1
		lw t1, 4(a1)
		bge t1, t0, LASER_EM_COOLDOWN	#if t1 >= t0, FIM
		
		la t1, mapa_teste_153		#endereco do mini_background
		addi t1, t1, 8			#pula a largura e a altura
		li t3, 153			#carrega 4 em t3
		lb t4, 1(a0)			#carrega o y em t4
		mul t4, t4, t3			#em qual linha o CHAR est 
		lb t3, 2(a0)			#carrega o x em t3
		add t4, t4, t3			#em qual coluna o CHAR est 
		add t1, t1, t4			#endereco do CHAR_POS na matriz
		mv t0, zero
		LIGA:
		li t3, 20
		sb t3, 0(t1)
		addi t1, t1, -153
		lb t3, 0(t1)
		li t2, 5
		beq t2, t3, MORTE
		li t2, 7
		beq t2, t3, MORTE 
		lb t2, 0(a0)
		beq t0, t2, CONT
		addi t0, t0, 1
		j LIGA
		
		CONT:
		li t1, 1
		sb t1, 3(a0)
		csrr t0, time
		sw t0, 0(a1)
		ret
		
DESLIGA:
		la t0, TEMPO_ATUAL		#carrega o endereco do TEMPO_ATUAL
		lw t0, 0(t0)			#carrega o TEMPO_ATUAL
		lw t1, 0(a1)			#carrega o TEMPO_PARA_COMECAR_A_CAIR
		sub t0, t0, t1			#t0 = t0 - t1
		lw t1, 4(a1)
		bge t1, t0, LASER_EM_COOLDOWN	#if t1 >= t0, FIM
		la t1, mapa_teste_153		#endereco do mini_background
		addi t1, t1, 8			#pula a largura e a altura
		li t3, 153			#carrega 4 em t3
		lb t4, 1(a0)			#carrega o y em t4
		mul t4, t4, t3			#em qual linha o CHAR est 
		lb t3, 2(a0)			#carrega o x em t3
		add t4, t4, t3			#em qual coluna o CHAR est 
		add t1, t1, t4			#endereco do CHAR_POS na matriz
		li t3, 100
		mv t0, zero
		DESLIGA_PROC:
		lb t2, 0(a0)
		li t3, 0
		sb t3, 0(t1)
		addi t1, t1, -153
		beq t0, t2, CONT2
		addi t0, t0, 1
		j DESLIGA_PROC
		CONT2:
		sb zero, 3(a0)
		csrr t0, time
		sw t0, 0(a1)
		ret
		
LASER_EM_COOLDOWN:
		ret

INIMIGOS_MAPA_3:
		la t0, VIDA_BOSS
		lb t0, 0(t0)
		beq t0, zero, FIM_DO_BOSS
		li t0, 1			#t0 = 1
		and t0, s0, t0			#t0 = t0 and s7
		beq t0, zero, BOSS_RED		#if a3 == t0, CASE3_2
		li t5, 60
		j BOSS_COLOR
		BOSS_RED:
		li t5, 61
		j BOSS_COLOR

FIM_DO_BOSS:
		la t0, BOSS_MORTO
		sb zero, 0(t0)
		li t5, 0
		j BOSS_COLOR
		ret
BOSS_COLOR:
		la t0, mapa_teste_153	#endereco do mini_background
		addi t0, t0, 8		#pula a largura e a altura
		la t2, BOSS_POS		#endereco de CHAR_POS
		li t3, 153		#carrega 8 em t3
		lh t4, 0(t2)		#carrega o y em t4
		mul t4, t4, t3		#em qual linha o CHAR est 
		lh t3, 2(t2)		#carrega o x em t3
		add t4, t4, t3		#em qual coluna o CHAR est 
		add t0, t0, t4		#endereco do CHAR_POS na matriz
		mv t2, t5
		sb t2, 0(t0)
		addi t0, t0, 1
		sb t2, 0(t0)
		addi t0, t0, 1
		sb t2, 0(t0)
		addi t0, t0, 1
		sb t2, 0(t0)
		addi t0, t0, 1
		sb t2, 0(t0)
		addi t0, t0, -153
		sb t2, 0(t0)
		addi t0, t0, -1
		sb t2, 0(t0)
		addi t0, t0, -1
		sb t2, 0(t0)
		addi t0, t0, -1
		sb t2, 0(t0)
		addi t0, t0, -1
		sb t2, 0(t0)
		addi t0, t0, -153
		sb t2, 0(t0)
		addi t0, t0, 1
		sb t2, 0(t0)
		addi t0, t0, 1
		sb t2, 0(t0)
		addi t0, t0, 1
		sb t2, 0(t0)
		addi t0, t0, 1
		sb t2, 0(t0)
		addi t0, t0, -153
		sb t2, 0(t0)
		addi t0, t0, -1
		sb t2, 0(t0)
		addi t0, t0, -1
		sb t2, 0(t0)
		addi t0, t0, -1
		sb t2, 0(t0)
		addi t0, t0, -1
		sb t2, 0(t0)
